import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
i

function App() {
  return (
    <>
    <Router>
    <Navbar />

    <Switch>
    <Route path='/' exact element={<Home />} />
    </Switch>

    </Router>
    </>
  );
}

export default App;
